import {faCog, faMap, faUser} from '@fortawesome/free-solid-svg-icons'
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import React from 'react';

import MenuItem from './MenuItem.js'

function MainMenu() {
  return (<div className = 'MainMenu'>
          <MenuItem name = 'Identifícate' icon = {faUser}>
          </MenuItem>
          <MenuItem name='Mapa' icon={faMap}></MenuItem>
          <MenuItem name = 'Configuración' icon = {faCog}>
          </MenuItem>
      </div>);
}

export default MainMenu;
